import React from 'react'

export default class Contact extends React.Component{

    render() {
        return (
            <div id="contact">
                <h1>Let's Keep In Touch!</h1>
                <ul><div>Email:</div> <a href="mailto:minheekangg@gmail.com"> minheekangg@gmail.com</a> </ul>
                <ul><p>LinkedIn: <a href="https://www.linkedin.com/in/min-hee-park-kang-1233ba69/">@min-hee-park-kang-1233ba69</a> </p></ul>
                <ul><p>Github: <a href="https://github.com/minheekangg">@minheekangg</a> </p>
                </ul>
                <ul><p>Instagram: <a href="https://www.instagram.com/minhehehe/">@minhehehe</a> </p>
                </ul>

            </div>
        )
    }
}
